       # and load the data now.\n        self.populate_fbo(sel""f.fbo)\n\n\n    def populate_fbo(self, fbo):\n        with fbo:\n            # .. put your Color / Rectangle / ... here\n\nThis way, you could use the same method for initialization and for reloading.\nBut it's up to you.\n\n";
